function [x,fx] = find_minimum(f,a,b,epsilon)
    c = (3-sqrt(5))/2;
    xa = a + c*(b-a);
    xb = b - c*(b-a);
    not_first_time = false;
    while abs(a-b) >= epsilon
        if f(xa) < f(xb)
            b = xb;
            xb = xa;
            xa = a + c*(b-a);
        elseif f(xa) > f(xb)
            a = xa;
            xa = xb;
            xb = b - c*(b-a);
        end
    fprintf('a = %f\nx_a = %f\nx_b = %f\nb = %f\n--------\n',a,xa,xb,b)
    
    hold('on')
    if not_first_time
        delete(a_plot)
        delete(xa_plot)
        delete(xb_plot)
        delete(b_plot)
    end
    a_plot = plot(a,f(a),'mo');
    xa_plot = plot(xa,f(xa), 'mo');
    xb_plot = plot(xb,f(xb), 'mo');
    b_plot = plot(b,f(b), 'mo');
    not_first_time = true;

    
    pause(1.5)
    
    end
x = xa;
fx = f(xa);
end

