            e.Level.text = UpgradeLevel.ToString();
            e.Emeralds.text = (e.CurrentEmeralds() - e.CurrentCost()).ToString();
            int nCost = (int)(e.CurrentCost() * 1.5f);
            e.CostLabel.text = nCost.ToString();

            e.SetUpgradeColor();
            villager.UpdateAllUpgrades();
        }
